Fashion Brigitta Bulgari DVDRip.avi

Brigitta Bui Kocsis is a beautiful model who came to Milan for fame and success in the fashion world. She has met a lot of people in Milan that have promised her a wonderful career in the fashion world, but only one person can make those promises real. To get to the top, she has to satisfy all his wishes. A real-life story that exposes you to the dazzling fashion world and what takes place behind the curtains. You will also have to pleasure to see the beautiful Brigitta Bui Kocsis in her first hardcore performances.

